import React from 'react';
import { useParams } from 'react-router-dom';

const PostDetail = () => {
  // Obter o parâmetro de rota para obter o ID do post
  const { id } = useParams();

  // Exemplo de dados fictícios para o post específico
  const post = {
    id: Number(id),
    title: 'Título do Post',
    content: 'Conteúdo do post. Mais detalhes sobre o conteúdo específico do post.',
  };

  return (
    <div>
      <h2>{post.title}</h2>
      <p>{post.content}</p>
    </div>
  );
};

export default PostDetail;
